use actix_web::{get, post, web, App, HttpResponse, Responder, HttpRequest};
use actix_files as files;
use crate::forth_integration; // Import the Forth integration module
use std::sync::Mutex;
use lazy_static::lazy_static;

lazy_static! {
    pub static ref HTML_CONTENT: Mutex<String> = Mutex::new(String::new());
}

#[get("/")]
async fn hello() -> impl Responder {
    let content = HTML_CONTENT.lock().unwrap().clone();
    HttpResponse::Ok().body(content)
}

#[post("/echo")]
async fn echo(req_body: String) -> impl Responder {
    HttpResponse::Ok().body(req_body)
}

async fn execute_forth(req_body: String, _: HttpRequest) -> impl Responder {
    let response = forth_integration::execute_forth(&req_body);
    HttpResponse::Ok().body(response)
}

async fn manual_hello() -> impl Responder {
    HttpResponse::Ok().body("Hey there!")
}

